/**
 * @namespace <p>An action bar is a window feature that identifies the application and user location,
and provides user actions and navigation modes.</p>
 * @since [{'name': 'Titanium Mobile SDK - Android', 'version': '3.0'}]
 * 
 * @example Action Bar using Alloy XML Markup
 * <p>Adds action items and sets several properties on a window's action bar in the XML and TSS files.</p>
<p><code>app/views/index.xml</code>:</p>
<pre><code class="language-xml">&lt;Alloy&gt;
    &lt;Window title=&quot;My Test App&quot;&gt;
        &lt;ActionBar id=&quot;actionbar&quot; title=&quot;My XML Menu&quot; onHomeIconItemSelected=&quot;doMenuClick&quot; /&gt;
        &lt;Menu&gt;
            &lt;MenuItem id=&quot;item1&quot; title=&quot;Settings&quot; onClick=&quot;openSettings&quot; /&gt;
            &lt;MenuItem id=&quot;item2&quot; title=&quot;Search&quot; onClick=&quot;doSearch&quot; /&gt;
        &lt;/Menu&gt;
        &lt;Label id=&quot;label&quot;&gt;Welcome!&lt;/Label&gt;
    &lt;/Window&gt;
&lt;/Alloy&gt;
</code></pre>
<p><code>app/controllers/index.js</code>:</p>
<pre><code>function doMenuClick() {}
function openSettings() {}
function doSearch() {}
$.index.open();
</code></pre>
<p><code>app/styles/index.tss</code>:</p>
<pre><code>&quot;MenuItem&quot;: {
    showAsAction: Ti.Android.SHOW_AS_ACTION_ALWAYS
},
&quot;#item1&quot;: {
    icon: Ti.Android.R.drawable.ic_menu_preferences
},
&quot;#item2&quot;: {
    icon: Ti.Android.R.drawable.ic_menu_search
},
&quot;#actionbar&quot;: {
    icon: &quot;/actionicon.png&quot;,
    displayHomeAsUp: true,
    backgroundImage: &quot;/actionbackground.png&quot;
}
</code></pre>
 * 
 * @example Action Bar Example
 * <pre><code>The following example sets several properties on a window's action bar.
<pre><code class="language-js">const win = Ti.UI.createWindow({
    title: &quot;Old Title&quot;,
    navBarHidden: false
});
if (OS_ANDROID) {
    win.activity.onCreate = () =&gt; {
        const actionBar = win.activity.actionBar;
        if (actionBar) {
            actionBar.backgroundImage = Ti.Filesystem.getFile(Ti.Filesystem.resourcesDirectory, 'bg.png').nativePath;
            actionBar.title = &quot;New Title&quot;;
            actionBar.onHomeIconItemSelected = () =&gt; {
                Ti.API.info(&quot;Home icon clicked!&quot;);
            };
        }
    };
}
win.open();
</code></pre>
The above can be done for a tab group via its {@link Ti.UI.TabGroup.activity} property.
Note that individual tab windows do not have an activity. Only the root tab group (which hosts the tabs)
provides an activity property.</code></pre>
 */
