/**
 * @namespace <p>CardView provides a layout container with rounded corners and a shadow indicating the view is elevated.</p>
 * @since [{'name': 'Titanium Mobile SDK - Android', 'version': '5.1.0'}]
 * 
 * @example Simple Alloy example
 * <pre><code><pre><code class="language-xml">&lt;Alloy&gt;
    &lt;Window &gt;
        &lt;CardView height=&quot;100&quot; width=&quot;200&quot;&gt;
          &lt;Label text=&quot;CardView example&quot;/&gt;
        &lt;/CardView&gt;
    &lt;/Window&gt;
&lt;/Alloy&gt;
</code></pre></code></pre>
 * 
 * @example CardView used in a ScrollView
 * <pre><code>The following example creates a CardView used in a ScrollView.
<pre><code class="language-js">var win = Ti.UI.createWindow({
    title: 'Card Demo'
});
var scrollView = Ti.UI.createScrollView({
    layout: 'vertical'
});
for (var index = 1; index &lt;= 10; index++) {
    var cardView = Ti.UI.Android.createCardView({
        layout: 'vertical',
        padding: '16dp',
        top: '10dp',
        left: '10dp',
        right: '10dp',
    });
    cardView.add(Ti.UI.createLabel({
        text: 'Card ' + index,
        maxLines: 1,
        font: {
            fontSize: '20dp',
            fontWeight: 'bold'
        },
        width: Ti.UI.FILL
    }));
    cardView.add(Ti.UI.createLabel({
        text: 'This is the card view description text.\nThis is the 2nd line of text.',
        textAlign: Ti.UI.TEXT_ALIGNMENT_LEFT,
        width: Ti.UI.FILL
    }));
    scrollView.add(cardView);
}
win.add(scrollView);
win.open();
</code></pre></code></pre>
 */
